import React from 'react'
import './Timeline.css'
import Suggestions from './Suggestions'
import Posts  from './posts/Posts'

function Timeline() {
    const [posts, setPosts] = useState([
        {
          user: "redian_",
          postImage:
          "https://images.unsplash.com/photo-1502219684198-fa9b5164d9d7?q=80&w=3135&auto=format&fit=crop&ixlib=rb-4.0.3&ixid=M3wxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8fA%3D%3D",
          likes: 54,
          timestamp: "2d",
        },
        {
          user: "johndoe",
          postImage:
            "https://images.unsplash.com/photo-1575936123452-b67c3203c357?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxzZWFyY2h8Mnx8aW1hZ2V8ZW58MHx8MHx8&w=1000&q=80",
          likes: 432,
          timestamp: "2d",
        },
        {
          user: "mariussss",
          postImage:
            "https://upload.wikimedia.org/wikipedia/commons/thumb/b/b6/Image_created_with_a_mobile_phone.png/1200px-Image_created_with_a_mobile_phone.png",
          likes: 140,
          timestamp: "2d",
        },
        {
          user: "kobee_18",
          postImage:
            "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSGCAaQ5u1TMTij5ELPWi5-VPtlSqELw-R6lj0EpYmNcGt56kOQaCokzS0IK81MOSphlkw&usqp=CAU",
          likes: 14,
          timestamp: "2d",
        },
      ]);
  return (
    <div className='timeline'>
        <div className="timeline__left">
        <div className="timeline__posts">
          {posts.map((post) => (
            <Post
              user={post.user}
              postImage={post.postImage}
              likes={post.likes}
              timestamp={post.timestamp}
            />
          ))}
        </div>
        </div>
        <div className="timeline__right">
             <Suggestions/>
        </div>
    </div>
  )
}

export default Timeline
